import axios from 'axios';
import './App.css';
import Form from './componentes/Form';
import List from './componentes/List';

function App() {


  const baseURL = "http://localhost:8080/v1/customer";

  async function sendApiCreateUser(user) {

    console.log(user)
    //postUser(user);



    const response = await axios.post(baseURL, {crossdomain: true}, {
      firstName: user.firstName,
      lastName: user.lastName
    });

    // Chamada de API

  }



  return (


    <div>


      <Form createUser={sendApiCreateUser}/>


      <List></List>


    </div>



  )
}

export default App;
